import React, { useState } from 'react'

function Text() {
  const [text, setText] = useState('')
  const event = (e) => {setText(e.target.value)}
  return (
    <div>
      <input onChange={event}></input>
      <h1>{text}</h1>
    </div>
  )
}

export default Text
